INSERT INTO `cp_question` VALUES (1, '当我上网时，觉得很难停下来。', '[{\"title\":\"\\u662f\",\"score\":\"1\"},{\"title\":\"\\u5426\",\"score\":\"0\"}]', 1, '', '2023-08-29 22:19:33', '2023-08-29 22:19:33');
INSERT INTO `cp_question` VALUES (2, '其他人（如：朋友和家人）曾说过我应该少上网。', '[{\"title\":\"\\u662f\",\"score\":\"1\"},{\"title\":\"\\u5426\",\"score\":\"0\"}]', 1, '', '2023-08-29 22:19:33', '2023-08-29 22:19:33');
INSERT INTO `cp_question` VALUES (3, '我因为上网而睡眠不足。', '[{\"title\":\"\\u662f\",\"score\":\"1\"},{\"title\":\"\\u5426\",\"score\":\"0\"}]', 1, '', '2023-08-29 22:19:34', '2023-08-29 22:19:34');
INSERT INTO `cp_question` VALUES (4, '我经常因为喜欢上网而忽略日常生活中的义务（工作，学校，或家庭生活）。', '[{\"title\":\"\\u662f\",\"score\":\"1\"},{\"title\":\"\\u5426\",\"score\":\"0\"}]', 1, '', '2023-08-29 22:19:34', '2023-08-29 22:19:34');
INSERT INTO `cp_question` VALUES (5, '当我心情不好的时候，我经常上网。', '[{\"title\":\"\\u662f\",\"score\":\"1\"},{\"title\":\"\\u5426\",\"score\":\"0\"}]', 1, '', '2023-08-29 22:19:34', '2023-08-29 22:19:34');
INSERT INTO `cp_question` VALUES (6, '我发现开启一段对话是很困难的事。', '[{\"title\":\"\\u662f\",\"score\":\"1\"},{\"title\":\"\\u5426\",\"score\":\"0\"}]', 2, '', '2023-08-29 22:19:34', '2023-08-29 22:19:34');
INSERT INTO `cp_question` VALUES (7, '当我与人社交的时候，我很难找到正确的话题可聊。', '[{\"title\":\"\\u662f\",\"score\":\"1\"},{\"title\":\"\\u5426\",\"score\":\"0\"}]', 2, '', '2023-08-29 22:19:34', '2023-08-29 22:19:34');
INSERT INTO `cp_question` VALUES (8, '我经常担心他人并不认可我。', '[{\"title\":\"\\u662f\",\"score\":\"1\"},{\"title\":\"\\u5426\",\"score\":\"0\"}]', 2, '', '2023-08-29 22:19:34', '2023-08-29 22:19:34');
INSERT INTO `cp_question` VALUES (9, '如果我不知道对方是怎么看待我的话，我就会非常没有安全感。', '[{\"title\":\"\\u662f\",\"score\":\"1\"},{\"title\":\"\\u5426\",\"score\":\"0\"}]', 2, '', '2023-08-29 22:19:34', '2023-08-29 22:19:34');
INSERT INTO `cp_question` VALUES (10, '我是比较封闭自我的那种人。', '[{\"title\":\"\\u662f\",\"score\":\"1\"},{\"title\":\"\\u5426\",\"score\":\"0\"}]', 2, '', '2023-08-29 22:19:34', '2023-08-29 22:19:34');
INSERT INTO `cp_question` VALUES (11, '我偏向和人保持距离。', '[{\"title\":\"\\u662f\",\"score\":\"1\"},{\"title\":\"\\u5426\",\"score\":\"0\"}]', 2, '', '2023-08-29 22:19:34', '2023-08-29 22:19:34');
INSERT INTO `cp_question` VALUES (12, '我似乎完全不能积极乐观起来。', '[{\"title\":\"\\u662f\",\"score\":\"1\"},{\"title\":\"\\u5426\",\"score\":\"0\"}]', 3, '', '2023-08-29 22:19:34', '2023-08-29 22:19:34');
INSERT INTO `cp_question` VALUES (13, '我感到我没什么可期待的。', '[{\"title\":\"\\u662f\",\"score\":\"1\"},{\"title\":\"\\u5426\",\"score\":\"0\"}]', 3, '', '2023-08-29 22:19:34', '2023-08-29 22:19:34');
INSERT INTO `cp_question` VALUES (14, '我感到伤心和郁闷。', '[{\"title\":\"\\u662f\",\"score\":\"1\"},{\"title\":\"\\u5426\",\"score\":\"0\"}]', 3, '', '2023-08-29 22:19:34', '2023-08-29 22:19:34');
INSERT INTO `cp_question` VALUES (15, '我一度感到我对几乎任何事情都失去了兴趣。', '[{\"title\":\"\\u662f\",\"score\":\"1\"},{\"title\":\"\\u5426\",\"score\":\"0\"}]', 3, '', '2023-08-29 22:19:34', '2023-08-29 22:19:34');
INSERT INTO `cp_question` VALUES (16, '我感到生命没有价值。', '[{\"title\":\"\\u662f\",\"score\":\"1\"},{\"title\":\"\\u5426\",\"score\":\"0\"}]', 3, '', '2023-08-29 22:19:34', '2023-08-29 22:19:34');
INSERT INTO `cp_question` VALUES (17, '我发现我自己被一些琐碎的事情弄得很不开心。', '[{\"title\":\"\\u662f\",\"score\":\"1\"},{\"title\":\"\\u5426\",\"score\":\"0\"}]', 4, '', '2023-08-29 22:19:34', '2023-08-29 22:19:34');
INSERT INTO `cp_question` VALUES (18, '我对于所处的环境（情况）易于反应过度。', '[{\"title\":\"\\u662f\",\"score\":\"1\"},{\"title\":\"\\u5426\",\"score\":\"0\"}]', 4, '', '2023-08-29 22:19:34', '2023-08-29 22:19:34');
INSERT INTO `cp_question` VALUES (19, '我发现很难放松下来。', '[{\"title\":\"\\u662f\",\"score\":\"1\"},{\"title\":\"\\u5426\",\"score\":\"0\"}]', 4, '', '2023-08-29 22:19:34', '2023-08-29 22:19:34');
INSERT INTO `cp_question` VALUES (20, '我发现我极其容易不开心。', '[{\"title\":\"\\u662f\",\"score\":\"1\"},{\"title\":\"\\u5426\",\"score\":\"0\"}]', 4, '', '2023-08-29 22:19:34', '2023-08-29 22:19:34');
INSERT INTO `cp_question` VALUES (21, '我感到时常神经紧张。', '[{\"title\":\"\\u662f\",\"score\":\"1\"},{\"title\":\"\\u5426\",\"score\":\"0\"}]', 4, '', '2023-08-29 22:19:34', '2023-08-29 22:19:34');
INSERT INTO `cp_question` VALUES (22, '我会避免、厌恶或不情愿去参加需要持续精神努力的任务。', '[{\"title\":\"\\u662f\",\"score\":\"1\"},{\"title\":\"\\u5426\",\"score\":\"0\"}]', 5, '', '2023-08-29 22:19:34', '2023-08-29 22:19:34');
INSERT INTO `cp_question` VALUES (23, '我会在教室或其他需要留在座位上的场合离开座位。', '[{\"title\":\"\\u662f\",\"score\":\"1\"},{\"title\":\"\\u5426\",\"score\":\"0\"}]', 5, '', '2023-08-29 22:19:34', '2023-08-29 22:19:34');
INSERT INTO `cp_question` VALUES (24, '我会在不适当的情景下四处奔跑或攀爬。', '[{\"title\":\"\\u662f\",\"score\":\"1\"},{\"title\":\"\\u5426\",\"score\":\"0\"}]', 5, '', '2023-08-29 22:19:34', '2023-08-29 22:19:34');
INSERT INTO `cp_question` VALUES (25, '我总是忍不住想说话。', '[{\"title\":\"\\u662f\",\"score\":\"1\"},{\"title\":\"\\u5426\",\"score\":\"0\"}]', 5, '', '2023-08-29 22:19:34', '2023-08-29 22:19:34');
INSERT INTO `cp_question` VALUES (26, '我很容易被别人激怒。', '[{\"title\":\"\\u662f\",\"score\":\"1\"},{\"title\":\"\\u5426\",\"score\":\"0\"}]', 5, '', '2023-08-29 22:19:34', '2023-08-29 22:19:34');
INSERT INTO `cp_question` VALUES (27, '我经常因为作业的事情睡不好觉。', '[{\"title\":\"\\u662f\",\"score\":\"1\"},{\"title\":\"\\u5426\",\"score\":\"0\"}]', 6, '', '2023-08-29 22:19:34', '2023-08-29 22:19:34');
INSERT INTO `cp_question` VALUES (28, '我会因为在空闲时间里有很多作业而感到压力。', '[{\"title\":\"\\u662f\",\"score\":\"1\"},{\"title\":\"\\u5426\",\"score\":\"0\"}]', 6, '', '2023-08-29 22:19:34', '2023-08-29 22:19:34');
INSERT INTO `cp_question` VALUES (29, '作业的压力会扰乱我在校外的生活。', '[{\"title\":\"\\u662f\",\"score\":\"1\"},{\"title\":\"\\u5426\",\"score\":\"0\"}]', 6, '', '2023-08-29 22:19:34', '2023-08-29 22:19:34');
INSERT INTO `cp_question` VALUES (30, '我感觉在做作业的时候我缺乏动力。', '[{\"title\":\"\\u662f\",\"score\":\"1\"},{\"title\":\"\\u5426\",\"score\":\"0\"}]', 6, '', '2023-08-29 22:19:34', '2023-08-29 22:19:34');
INSERT INTO `cp_question` VALUES (31, '我感觉我对我的作业失去了兴趣。', '[{\"title\":\"\\u662f\",\"score\":\"1\"},{\"title\":\"\\u5426\",\"score\":\"0\"}]', 6, '', '2023-08-29 22:19:34', '2023-08-29 22:19:34');
INSERT INTO `cp_question` VALUES (32, '我总是怀疑我的作业是否有意义', '[{\"title\":\"\\u662f\",\"score\":\"1\"},{\"title\":\"\\u5426\",\"score\":\"0\"}]', 6, '', '2023-08-29 22:19:34', '2023-08-29 22:19:34');
INSERT INTO `cp_question` VALUES (33, '在过去的一个月，我经常由于睡眠不好而导致思维困难。', '[{\"title\":\"\\u662f\",\"score\":\"1\"},{\"title\":\"\\u5426\",\"score\":\"0\"}]', 7, '', '2023-08-29 22:19:34', '2023-08-29 22:19:34');
INSERT INTO `cp_question` VALUES (34, '在过去的一个月，我通常能在睡眠后缓解疲劳。', '[{\"title\":\"\\u662f\",\"score\":\"0\"},{\"title\":\"\\u5426\",\"score\":\"1\"}]', 7, '', '2023-08-29 22:19:34', '2023-09-11 09:19:30');
INSERT INTO `cp_question` VALUES (35, '在过去的一个月，我经常在夜间醒来后很难再入睡。', '[{\"title\":\"\\u662f\",\"score\":\"1\"},{\"title\":\"\\u5426\",\"score\":\"0\"}]', 7, '', '2023-08-29 22:19:34', '2023-08-29 22:19:34');
INSERT INTO `cp_question` VALUES (36, '在过去的一个月，我起床后经常希望有更多的睡眠。', '[{\"title\":\"\\u662f\",\"score\":\"1\"},{\"title\":\"\\u5426\",\"score\":\"0\"}]', 7, '', '2023-08-29 22:19:34', '2023-08-29 22:19:34');
INSERT INTO `cp_question` VALUES (37, '在过去的一个月，我对睡眠满意。', '[{\"title\":\"\\u662f\",\"score\":\"0\"},{\"title\":\"\\u5426\",\"score\":\"1\"}]', 7, '', '2023-08-29 22:19:34', '2023-09-11 09:19:37');
INSERT INTO `cp_question` VALUES (38, '在过去的一个月，我经常被噪音吵醒。', '[{\"title\":\"\\u662f\",\"score\":\"1\"},{\"title\":\"\\u5426\",\"score\":\"0\"}]', 7, '', '2023-08-29 22:19:34', '2023-08-29 22:19:34');
INSERT INTO `cp_question` VALUES (39, '我会欺负同学。', '[{\"title\":\"\\u662f\",\"score\":\"1\"},{\"title\":\"\\u5426\",\"score\":\"0\"}]', 8, '', '2023-08-29 22:19:34', '2023-08-29 22:19:34');
INSERT INTO `cp_question` VALUES (40, '我会虐待动物和他人。', '[{\"title\":\"\\u662f\",\"score\":\"1\"},{\"title\":\"\\u5426\",\"score\":\"0\"}]', 8, '', '2023-08-29 22:19:34', '2023-08-29 22:19:34');
INSERT INTO `cp_question` VALUES (41, '我有偷窃、敲诈的行为。', '[{\"title\":\"\\u662f\",\"score\":\"1\"},{\"title\":\"\\u5426\",\"score\":\"0\"}]', 8, '', '2023-08-29 22:19:34', '2023-08-29 22:19:34');
INSERT INTO `cp_question` VALUES (42, '我喜欢捉弄他人。', '[{\"title\":\"\\u662f\",\"score\":\"1\"},{\"title\":\"\\u5426\",\"score\":\"0\"}]', 8, '', '2023-08-29 22:19:34', '2023-08-29 22:19:34');
INSERT INTO `cp_question` VALUES (43, '我不能够较好地遵守校规、秩序。', '[{\"title\":\"\\u662f\",\"score\":\"1\"},{\"title\":\"\\u5426\",\"score\":\"0\"}]', 8, '', '2023-08-29 22:19:34', '2023-08-29 22:19:34');
INSERT INTO `cp_question` VALUES (44, '我在新环境里要花上不少时间克服羞怯。', '[{\"title\":\"\\u662f\",\"score\":\"1\"},{\"title\":\"\\u5426\",\"score\":\"0\"}]', 9, '', '2023-08-29 22:19:35', '2023-08-29 22:19:35');
INSERT INTO `cp_question` VALUES (45, '有人看着我时，我干活会很吃力。', '[{\"title\":\"\\u662f\",\"score\":\"1\"},{\"title\":\"\\u5426\",\"score\":\"0\"}]', 9, '', '2023-08-29 22:19:35', '2023-08-29 22:19:35');
INSERT INTO `cp_question` VALUES (46, '我非常容易困窘。', '[{\"title\":\"\\u662f\",\"score\":\"1\"},{\"title\":\"\\u5426\",\"score\":\"0\"}]', 9, '', '2023-08-29 22:19:35', '2023-08-29 22:19:35');
INSERT INTO `cp_question` VALUES (47, '我同陌生人谈话很容易。', '[{\"title\":\"\\u662f\",\"score\":\"0\"},{\"title\":\"\\u5426\",\"score\":\"1\"}]', 9, '', '2023-08-29 22:19:35', '2023-09-11 09:19:51');
INSERT INTO `cp_question` VALUES (48, '我在人群前谈话时感到紧张。', '[{\"title\":\"\\u662f\",\"score\":\"1\"},{\"title\":\"\\u5426\",\"score\":\"0\"}]', 9, '', '2023-08-29 22:19:35', '2023-08-29 22:19:35');
INSERT INTO `cp_question` VALUES (49, '一大群人会使我紧张。', '[{\"title\":\"\\u662f\",\"score\":\"1\"},{\"title\":\"\\u5426\",\"score\":\"0\"}]', 9, '', '2023-08-29 22:19:35', '2023-08-29 22:19:35');
INSERT INTO `cp_question` VALUES (50, '相比和朋友在一起，我更愿意花时间在社交媒体上。', '[{\"title\":\"\\u662f\",\"score\":\"1\"},{\"title\":\"\\u5426\",\"score\":\"0\"}]', 10, '', '2023-08-29 22:19:35', '2023-08-29 22:19:35');
INSERT INTO `cp_question` VALUES (51, '在开始使用社交媒体后，我会觉得自己正在远离现实生活中的朋友。', '[{\"title\":\"\\u662f\",\"score\":\"1\"},{\"title\":\"\\u5426\",\"score\":\"0\"}]', 10, '', '2023-08-29 22:19:35', '2023-08-29 22:19:35');
INSERT INTO `cp_question` VALUES (52, '我认为社交媒体的使用影响了我的学习表现。', '[{\"title\":\"\\u662f\",\"score\":\"1\"},{\"title\":\"\\u5426\",\"score\":\"0\"}]', 10, '', '2023-08-29 22:19:35', '2023-08-29 22:19:35');
INSERT INTO `cp_question` VALUES (53, '当我使用社交媒体的行为受到质疑时，我会做出防御性的回应。', '[{\"title\":\"\\u662f\",\"score\":\"1\"},{\"title\":\"\\u5426\",\"score\":\"0\"}]', 10, '', '2023-08-29 22:19:35', '2023-08-29 22:19:35');
INSERT INTO `cp_question` VALUES (54, '当被激怒到一定程度，我可能会打其他人。', '[{\"title\":\"\\u662f\",\"score\":\"1\"},{\"title\":\"\\u5426\",\"score\":\"0\"}]', 11, '', '2023-08-29 22:19:35', '2023-08-29 22:19:35');
INSERT INTO `cp_question` VALUES (55, '如果我不得不采取暴力措施去保护自己的权利，我会这样做的。', '[{\"title\":\"\\u662f\",\"score\":\"1\"},{\"title\":\"\\u5426\",\"score\":\"0\"}]', 11, '', '2023-08-29 22:19:35', '2023-08-29 22:19:35');
INSERT INTO `cp_question` VALUES (56, '有时我会无缘无故地发脾气。', '[{\"title\":\"\\u662f\",\"score\":\"1\"},{\"title\":\"\\u5426\",\"score\":\"0\"}]', 11, '', '2023-08-29 22:19:35', '2023-08-29 22:19:35');
INSERT INTO `cp_question` VALUES (57, '我没法控制自己的脾气。', '[{\"title\":\"\\u662f\",\"score\":\"1\"},{\"title\":\"\\u5426\",\"score\":\"0\"}]', 11, '', '2023-08-29 22:19:35', '2023-08-29 22:19:35');
INSERT INTO `cp_question` VALUES (58, '我感觉别人似乎总是运气比我好。', '[{\"title\":\"\\u662f\",\"score\":\"1\"},{\"title\":\"\\u5426\",\"score\":\"0\"}]', 11, '', '2023-08-29 22:19:35', '2023-08-29 22:19:35');
INSERT INTO `cp_question` VALUES (59, '我有时会觉得有人在我背后嘲笑我。', '[{\"title\":\"\\u662f\",\"score\":\"1\"},{\"title\":\"\\u5426\",\"score\":\"0\"}]', 11, '', '2023-08-29 22:19:35', '2023-08-29 22:19:35');
INSERT INTO `cp_question` VALUES (60, '我会为了得到我想要的东西而不在乎我伤害了谁。', '[{\"title\":\"\\u662f\",\"score\":\"1\"},{\"title\":\"\\u5426\",\"score\":\"0\"}]', 12, '', '2023-08-29 22:19:35', '2023-08-29 22:19:35');
INSERT INTO `cp_question` VALUES (61, '我会关心他人的感受。', '[{\"title\":\"\\u662f\",\"score\":\"0\"},{\"title\":\"\\u5426\",\"score\":\"1\"}]', 12, '', '2023-08-29 22:19:35', '2023-09-11 09:20:04');
INSERT INTO `cp_question` VALUES (62, '我总是会尽自己最大的努力。', '[{\"title\":\"\\u662f\",\"score\":\"0\"},{\"title\":\"\\u5426\",\"score\":\"1\"}]', 12, '', '2023-08-29 22:19:35', '2023-09-11 09:20:08');
INSERT INTO `cp_question` VALUES (63, '我做任何事都会努力。', '[{\"title\":\"\\u662f\",\"score\":\"0\"},{\"title\":\"\\u5426\",\"score\":\"1\"}]', 12, '', '2023-08-29 22:19:35', '2023-09-11 09:20:14');
INSERT INTO `cp_question` VALUES (64, '我会公开表达我的感受。', '[{\"title\":\"\\u662f\",\"score\":\"0\"},{\"title\":\"\\u5426\",\"score\":\"1\"}]', 12, '', '2023-08-29 22:19:35', '2023-09-11 09:20:18');
INSERT INTO `cp_question` VALUES (65, '我是非常善于表现的和感性的。', '[{\"title\":\"\\u662f\",\"score\":\"0\"},{\"title\":\"\\u5426\",\"score\":\"1\"}]', 12, '', '2023-08-29 22:19:35', '2023-09-11 09:20:26');
INSERT INTO `cp_question` VALUES (66, '在过去的12个月里，你是否认真地考虑过自杀？', '[{\"title\":\"\\u662f\",\"score\":\"1\"},{\"title\":\"\\u5426\",\"score\":\"0\"}]', 13, '', '2023-08-29 22:19:35', '2023-08-29 22:19:35');
INSERT INTO `cp_question` VALUES (67, '你是否制定过自杀计划？', '[{\"title\":\"\\u662f\",\"score\":\"1\"},{\"title\":\"\\u5426\",\"score\":\"0\"}]', 14, '', '2023-08-29 22:19:35', '2023-08-29 22:19:35');
INSERT INTO `cp_question` VALUES (68, '你是否真正尝试过自杀？', '[{\"title\":\"\\u662f\",\"score\":\"1\"},{\"title\":\"\\u5426\",\"score\":\"0\"}]', 15, '', '2023-08-29 22:19:35', '2023-08-29 22:19:35');
